import React, { useState } from 'react';
import { Box, Typography, TextField, CircularProgress } from '@mui/material';
import ProfileDisplay from './ProfileDisplay';
import PredictionResult from './PredictionResult';

const LinkedInInput = () => {
  const [linkedinUrl, setLinkedinUrl] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [profileData, setProfileData] = useState(null);
  const [predictionData, setPredictionData] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);
    setProfileData(null);
    setPredictionData(null);

    try {
      // LinkedIn-Profil abrufen
      const profileResponse = await fetch('/scrape-linkedin', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ url: linkedinUrl })
      });

      if (!profileResponse.ok) {
        const errorData = await profileResponse.json();
        throw new Error(errorData.error || 'Fehler beim Laden des LinkedIn-Profils');
      }

      const profile = await profileResponse.json();
      setProfileData(profile);

      // Karriere-Vorhersage
      const careerHistory = profile.experience.map(exp => ({
        position: exp.title,
        company: exp.company,
        startDate: exp.duration.split(' - ')[0],
        endDate: exp.duration.split(' - ')[1] === 'Present' ? null : exp.duration.split(' - ')[1]
      }));

      const predictionResponse = await fetch('/predict', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          experiences: careerHistory,
          modelType: 'tft'
        })
      });

      if (!predictionResponse.ok) {
        const errorData = await predictionResponse.json();
        throw new Error(errorData.error || 'Fehler bei der Karriere-Analyse');
      }

      const prediction = await predictionResponse.json();
      setPredictionData(prediction);

    } catch (error) {
      setError(error.message);
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box sx={{ maxWidth: '1200px', margin: '0 auto' }}>
      <Box className="form-group" sx={{
        bgcolor: 'var(--white)',
        borderRadius: '16px',
        p: '30px',
        boxShadow: 'var(--shadow)',
        mb: '30px'
      }}>
        <Typography variant="h3" sx={{
          color: 'var(--aurio-blue)',
          fontSize: '1.5rem',
          mb: '20px',
          fontWeight: 600
        }}>
          LinkedIn Profil
        </Typography>

        <Box component="form" onSubmit={handleSubmit} className="linkedin-input-wrapper">
          <TextField
            fullWidth
            value={linkedinUrl}
            onChange={(e) => setLinkedinUrl(e.target.value)}
            placeholder="https://www.linkedin.com/in/username"
            className="linkedin-input"
            sx={{
              '& .MuiOutlinedInput-root': {
                '& fieldset': {
                  borderColor: 'var(--border-color)',
                  borderWidth: '2px'
                },
                '&:hover fieldset': {
                  borderColor: 'var(--aurio-blue)'
                },
                '&.Mui-focused fieldset': {
                  borderColor: 'var(--aurio-blue)',
                  boxShadow: '0 0 0 2px rgba(0, 27, 65, 0.1)'
                }
              }
            }}
          />

          <button
            type="submit"
            className="btn-primary"
            disabled={loading}
            style={{
              width: '40%',
              background: 'var(--aurio-blue)',
              color: 'var(--white)',
              border: 'none',
              padding: '14px',
              borderRadius: '8px',
              fontSize: '1rem',
              fontWeight: 600,
              cursor: 'pointer',
              transition: 'all 0.3s ease',
              display: 'flex',
              justifyContent: 'center',
              alignItems: 'center',
              margin: '0 auto',
              textAlign: 'center'
            }}
          >
            Profil analysieren
          </button>
        </Box>
      </Box>

      {loading && (
        <Box className="loader-container-prediction" sx={{
          display: 'flex',
          flexDirection: 'column',
          justifyContent: 'center',
          alignItems: 'center',
          height: '150px',
          my: '20px',
          gap: '20px'
        }}>
          <Box className="loader-prediction" sx={{
            position: 'relative',
            display: 'inline-flex'
          }}>
            <CircularProgress
              size={40}
              thickness={4}
              sx={{
                color: 'var(--aurio-orange)',
                '& .MuiCircularProgress-circle': {
                  strokeLinecap: 'round',
                }
              }}
            />
          </Box>
        </Box>
      )}

      {error && (
        <Box className="error-message" sx={{
          bgcolor: '#FEE2E2',
          border: '1px solid #FCA5A5',
          color: '#DC2626',
          p: 3,
          borderRadius: 2,
          mb: 3
        }}>
          <Typography variant="h6" sx={{ mb: 1 }}>Fehler</Typography>
          <Typography>{error}</Typography>
          <Box component="ul" sx={{ mt: 2, pl: 2 }}>
            <li>Stellen Sie sicher, dass die URL korrekt ist</li>
            <li>Das Profil muss öffentlich zugänglich sein</li>
            <li>Versuchen Sie es später erneut</li>
          </Box>
        </Box>
      )}

      {profileData && <ProfileDisplay profile={profileData} />}
      {predictionData && <PredictionResult prediction={predictionData} />}
    </Box>
  );
};

export default LinkedInInput;
